a3d9f19d-4f05-4e46-89a7-9b927ae147b8	Butternut Squash Soup	 2 tablespoons butter\r\n1 small onion, chopped\r\n1 stalk celery, chopped\r\n1 medium carrot, chopped\r\n2 medium potatoes, cubed\r\n1 medium butternut squash - peeled, seeded, and cubed\r\n1 (32 fluid ounce) container chicken stock\r\nsalt and freshly ground black pepper to taste 	 Step 1\r\n\r\nMelt the butter in a large pot, and cook the onion, celery, carrot, potatoes, and squash 5 minutes, or until lightly browned. Pour in enough of the chicken stock to cover vegetables. Bring to a boil. Reduce heat to low, cover pot, and simmer 40 minutes, or until all vegetables are tender.\r\nStep 2\r\n\r\nTransfer the soup to a blender, and blend until smooth. Return to pot, and mix in any remaining stock to attain desired consistency. Season with salt and pepper.\r\n	0d6cb128-1790-4349-b11f-a0a81620f538
4e4f7904-91b0-43ed-98d0-48f95c6111e3	Appel-perencrumble met kruidnoten	2 elstar-appels\r\n2 Conference peren\r\n2 tl speculaaskruiden\r\n55 g tarwebloem\r\n100 g rietsuiker\r\n80 g kruidnoten\r\n100 g ongezouten roomboter\r\n75 g grove havermoutvlokken\r\n1 mespunt zout	1\r\n\r\nVerwarm de oven voor op 180 C. Schil de appels en peren, verwijder het klokhuis en snijd ze in blokjes van 2 cm. Meng het fruit met de speculaaskruiden, 1 el bloem en 2 el rietsuiker (per 4 personen). Doe het fruitmengsel in de ingevette ovenschaal.\r\n2\r\n\r\nDoe de kruidnoten in een zip-lockzak-je of een schone theedoek. Verkruimel ze met een deegroller of ander zwaar voorwerp. Snijd de koude boter in blokjes. Meng de verkruimelde kruidnoten met de rest van de bloem, de suiker, de havermout, het zout en blokjes boter met je handen tot een kruimelig deeg. Wrijf hierbij de boter tussen je vingers door de andere ingredinten.\r\n3\r\n\r\nVerdeel het kruimelmengsel over het fruit in de ovenschaal, zodat alles bedekt is. Bak de crumble 20-25 min. in het midden van de oven.	0d6cb128-1790-4349-b11f-a0a81620f538
360e868e-a146-48a6-961e-c02cc82588c8	Smashed potatoes met gegratineerde kip	1 kg kruimige aardappel\r\n1 rode ui\r\n2 el wittewijnazijn\r\n1 sinaasappel\r\n500 g witlof\r\n1 zoete appel\r\n2 el extra romige mayonaise\r\n3 el milde olijfolie\r\n395 g kipdijfilet\r\n1 el paprikapoeder\r\n100 g De Zaanse Hoeve mild 30+ geraspt	1\r\n\r\nVerwarm de oven voor op 180 C. Boen de aardappelen schoon en kook in 20 min. gaar. Giet af en laat 5 min. droogstomen. Snijd de rode ui in dunne halve ringen. Giet de azijn erover en laat 15 min. staan. Schep halverwege om.\r\n2\r\n\r\nBoen de sinaasappel schoon, rasp de oranje schil en pers de vrucht uit. Snijd de onderkant van het witlof en snijd het lof in dunne ringen. Snijd de appel in vieren, verwijder het klokhuis en snijd de appel in blokjes van 1 cm. Meng het witlof, de appel, mayonaise en de helft van het sinaasappelrasp en -sap tot een salade. Breng op smaak met peper en eventueel zout.\r\n3\r\n\r\nPlet met een vork de aardappelen op een met bakpapier beklede bakplaat. Besprenkel met  van de olie en breng op smaak met peper en eventueel zout. Bak ca. 40 min. in het midden van de oven tot ze knapperig zijn.\r\n4\r\n\r\nSchep ondertussen de kip om met 2 el sinaasappelsap (per 4 personen), de rest van het rasp, de paprikapoeder en de rest van de olie. Verdeel over een met bakpapier beklede bakplaat. Bak 10 min. onder de aardappelen. Bestrooi de kip met de kaas en bak nog ca. 10 min. tot deze is gesmolten en de kip gaar is. Schep de gemarineerde ui door de salade en serveer met de gegratineerde kip en knapperige aardappelen.	0d6cb128-1790-4349-b11f-a0a81620f538
